Comment:
Mercury bequeathed the vast majority of his wealth, including his home and recording royalties, to Mary Austin, and the remainder to his parents and sister. He left 
¬£500,000 to his chef, Joe Fanelli; 
¬£500,000 to his personal assistant, Peter Freestone; 
¬£100,000 to his driver, Terry Giddings; and
¬£500,000 to Jim Hutton. 
Austin continues to live at Mercury's former home, Garden Lodge, Kensington, with her family.
